INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("フリーマーケット会場", "ペコリーヌとの出会い", 0, 2834, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 0, 5118061, 91002, "青空の下で謁見", 40, 1, 7, 2, 10118, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("フリーマーケット会場", "マホとの出会い", 0, 2835, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 0, 5118062, 91002, "未来の騎空団\nマスコット？", 40, 1, 7, 2, 10118, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("ランドソル市街地", "アキノとの出会い", 0, 2837, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 0, 5118063, 91002, "お嬢さまからの\n緊急依頼", 40, 1, 7, 2, 10118, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("フリーマーケット会場", "ジュンとの出会い", 0, 4108402, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 0, 5118064, 91002, "黄金色の悩みごと", 40, 1, 18, 2, 10118, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("フリーマーケット会場", "カオリとの出会い", 0, 4107402, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 0, 5118065, 91002, "白熱！　格闘大会！", 40, 1, 18, 2, 10118, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("オーエド町", "ニノンとの出会い", 0, 9000227, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 1, 5118066, 91002, "祭り太鼓はオーエドの華", 40, 1, 16, 2, 10118, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("フリーマーケット会場", "スズナとの出会い", 0, 2101181, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 0, 5118067, 91002, "人気者は遅れて\nやってくる", 40, 1, 19, 3, 10118, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("ランドソル市街地", "ナナカとの出会い", 0, 4109402, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 0, 5118068, 91002, "巫女・ミーツ・魔法少女", 40, 1, 18, 3, 10118, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("フリーマーケット会場", "キャル＆コッコロとの出会い", 0, 4305402, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 0, 5118069, 91002, "ネズ耳は二度なくなる", 40, 1, 18, 3, 10118, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("ランドソル市街地", "ユカリとの出会い", 0, 4101402, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 0, 5118070, 91002, "この出会いにカンパイ！", 40, 1, 18, 3, 10118, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("ランドソル市街地", "アオイとの出会い", 0, 4106402, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 0, 5118071, 91002, "陰陽アンサンブル", 40, 1, 18, 3, 10118, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("フリーマーケット会場", "シノブとの出会い", 0, 2836, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 1, 5118072, 91002, "運試し十番勝負！", 40, 1, 7, 3, 10118, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES (0, "オープニング", 10145115, 0, 0, 0, 5118600, 0, "彼女たちの新たな日常", 0, 0, 0, 1, 10118, 0);
